import React from 'react';
import {isEmpty, map} from "lodash";
import "../../../scss/ListUsers.scss";
const ListUsers = (props) => {
    const {users} = props
    if(isEmpty(users)){
        return(
            <h3>No se encontraron usuarios</h3>
        );
    }
    return (
        <h2>Hola</h2>
    );
}
export default ListUsers;
